        "import cv2\n",
        "import mediapipe as mp\n",
        "import numpy as np\n",
        "from IPython.display import display, Javascript, clear_output\n",
        "from google.colab.output import eval_js\n",
        "import base64\n",
        "\n",
        "# JS code to capture photo from webcam\n",
        "def take_photo(filename='photo.jpg', quality=0.8):\n",
        "    js = Javascript('''\n",
        "    async function takePhoto(quality) {\n",
        "      const div = document.createElement('div');\n",
        "      const capture = document.createElement('button');\n",
        "      capture.textContent = 'Capture';\n",
        "      div.appendChild(capture);\n",
        "      document.body.appendChild(div);\n",
        "\n",
        "      const video = document.createElement('video');\n",
        "      video.style.display = 'block';\n",
        "      document.body.appendChild(video);\n",
        "\n",
        "      const stream = await navigator.mediaDevices.getUserMedia({video: true});\n",
        "      video.srcObject = stream;\n",
        "      await video.play();\n",
        "\n",
        "      google.colab.output.setIframeHeight(document.documentElement.scrollHeight, true);\n",
        "\n",
        "      await new Promise((resolve) => capture.onclick = resolve);\n",
        "\n",
        "      const canvas = document.createElement('canvas');\n",
        "      canvas.width = video.videoWidth;\n",
        "      canvas.height = video.videoHeight;\n",
        "      canvas.getContext('2d').drawImage(video, 0, 0);\n",
        "      stream.getVideoTracks()[0].stop();\n",
        "      div.remove();\n",
        "      video.remove();\n",
        "      return canvas.toDataURL('image/jpeg', quality);\n",
        "    }\n",
        "    ''')\n",
        "    display(js)\n",
        "    data = eval_js('takePhoto({})'.format(quality))\n",
        "    binary = base64.b64decode(data.split(',')[1])\n",
        "    with open(filename, 'wb') as f:\n",
        "        f.write(binary)\n",
        "    return filename\n",
        "\n",
        "# Function to check which fingers are up\n",
        "def fingers_up(hand_landmarks):\n",
        "    tips = [4, 8, 12, 16, 20]\n",
        "    fingers = []\n",
        "    # Thumb (for right hand): tip.x < ip.x means open\n",
        "    if hand_landmarks.landmark[tips[0]].x < hand_landmarks.landmark[tips[0] - 1].x:\n",
        "        fingers.append(1)\n",
        "    else:\n",
        "        fingers.append(0)\n",
        "    # Other fingers: tip.y < pip.y means finger is up\n",
        "    for id in range(1,5):\n",
        "        if hand_landmarks.landmark[tips[id]].y < hand_landmarks.landmark[tips[id] - 2].y:\n",
        "            fingers.append(1)\n",
        "        else:\n",
        "            fingers.append(0)\n",
        "    return fingers\n",
        "\n",
        "# Main capture and detection\n",
        "filename = take_photo()\n",
        "img = cv2.imread(filename)\n",
        "\n",
        "mp_hands = mp.solutions.hands\n",
        "mp_drawing = mp.solutions.drawing_utils\n",
        "\n",
        "with mp_hands.Hands(static_image_mode=True, max_num_hands=2, min_detection_confidence=0.5) as hands:\n",
        "    img_rgb = cv2.cvtColor(img, cv2.COLOR_BGR2RGB)\n",
        "    results = hands.process(img_rgb)\n",
        "    if results.multi_hand_landmarks:\n",
        "        for hand_landmarks in results.multi_hand_landmarks:\n",
        "            fingers = fingers_up(hand_landmarks)\n",
        "            count = sum(fingers)\n",
        "            # Show count on image\n",
        "            cv2.putText(img, f'Fingers Up: {count}', (10, 40), cv2.FONT_HERSHEY_SIMPLEX, 1.2, (0,255,0), 3)\n",
        "            mp_drawing.draw_landmarks(img, hand_landmarks, mp_hands.HAND_CONNECTIONS)\n",
        "    else:\n",
        "        cv2.putText(img, \"No hand detected\", (10, 40), cv2.FONT_HERSHEY_SIMPLEX, 1.2, (0,0,255), 3)\n",
        "\n",
        "from google.colab.patches import cv2_imshow\n",
        "clear_output()\n",
        "cv2_imshow(img)\n",
        "cv2.waitKey(0)\n",
        "cv2.destroyAllWindows()\n"
